import React, { useEffect } from 'react'

function Home() {

    useEffect(() => {
        const fetchWorkouts = async () => {
            const response = await fetch('http://localhost:3000/api/workouts')
        }

        fetchWorkouts()
    },[])

    return (
        <div>
            <h2>Home</h2>
        </div>
    )
}

export default Home
